import './App.css';
import Tile from './Tile.js'

const darkTheme = createTheme({
  palette: {
    mode: 'dark',
  },
});

function App() {
  return (
    <>
      <Tile name='Animals' image='cat' isFolder={true} ></Tile>
      <Tile name='School' image='school' ></Tile>
    </>
  );
}

export default App;
